import "./App.css";

import React, { Component } from "react";
import { CrystalList } from "./components/crystal-list/crystal-list.jsx";
import CrystalDataServices from "./services/service";
import Crystal from "../../models/crystals";

class App extends Component {
  constructor() {
    super();
    this.state = {
      crystals: [],
    };
  }
  componentDidMount() {
    CrystalDataServices.getAll()
      .then((response) => this.setState({ crystals: response.data.data }))
      .catch((err) => console.log(err));
  }

  render() {
    console.log(this.state.crystals);
    return (
      <div className="App">
        <ul>
          {this.state.crystals.map((crystal) => (
            <li>{Crystal.name}</li>
          ))}
        </ul>
        {/* <input type="search" placeholder="search for crystals"></input>
        <h1>crystalized</h1>
        <CrystalList crystals={this.state.crystals} /> */}
      </div>
    );
  }
}

export default App;
